import React from 'react';
import styled from 'styled-components';

const Header = () => {
  return <Title>Github Profile Finder</Title>;
};

export default Header;

const Title = styled.h1`
  font-size: 32px;
  color: rgb(229, 230, 231);
  margin: 10px 0;
`;
